8 mm</td>  </tr>  <tr bgcolor=\"#d3d3d3\">   <td>    <b>Dynamic Load Rating:</b></td>   <td>4.75 kN</td>  </tr>  <tr bgcolor=\"#d3d3d3\">   <td>    <b>Static Load Rating:</b></td>   <td>1.96 kN</td>  </tr>  <tr bgcolor=\"#d3d3d3\">   <td>    <b>Fatigue Load Limit:</b></td>   <td>0.083 kN</td>  </tr>  <tr bgcolor=\"#d3d3d3\">   <td>    <b>Reference Speed:</b></td>   <td>67000 r/min</td>  </tr>  <tr bgcolor=\"#d3d3d3\">   <td>    <b>Limiting Speed:</b></td>   <td>40000 r/min</td>  </tr> </tbody></table></div><div>', '0.0', '2.46', '0.0', 'http://www.ebay.co.uk/itm/6000-Z-FAG-Metric-Ball-Bearing-/141111218122', 'http://www.ebay.co.uk/itm/6000-Z-FAG-Metric-Ball-Bearing-/141111218122', '310000', '310', 'GTC', 'FixedPriceItem', 'Rochester', 'PayPal<>', 'karl@kentbearings.com', '1267', 'Business, Office & Industrial:Industrial Supply/ MRO:Other Industrial Supply', '0.0', '4580655011', '0', '106', 'GBP', '2013-11-09 14:37:40', '2014-06-07 14:37:40', 'Active', '90', '29') 
